import './Landing.css';

function Landing () {
    return (
      <div className="Landing">
        <p className='banerText'>
          Оптовые поставки<br />
          минеральной воды<br />
          и безалкогольных напитков
        </p>
          <div className='baner'>
            <img src="img/grassOne.png" alt="grassOne" />
          </div>
      </div>
    );
  }

  export default Landing;
